import React from 'react';

import {NavLink } from 'react-router-dom';
const Navbar=()=>{
    return(
<>
<NavLink activeClassName="active_class" to="/">About </NavLink>
<NavLink activeClassName="active_class" to="/home">Home </NavLink>
<NavLink activeClassName="active_class" to="/project"> Project</NavLink>
<NavLink activeClassName="active_class" to="/contact">Contact</NavLink>
</>
    );
}
export default Navbar;
